description:
Jesse Dee is an R&amp;B and soul singer/song-writer and professional artist from 
Boston, Massachusetts.He has played as the opening act for Gospel/R&amp;B/Soul
legends Al Green and Etta James, respectively, and maintains a steady international touring schedule throughout 2009. Jesse Dee's current album entitled &quot;Bittersweet Batch&quot;


